using AutoMapper;
using OSA.Database.Infrastructure;
using OSA.DomainEntities;
using OSA.ServiceEntities;
using OSA.Services.Interfaces;
using OSA.Utility;
using static Microsoft.EntityFrameworkCore.DbLoggerCategory.Database;

namespace OSA.Services.Services
{
    public class CompanyService : ICompanyService
    {
        private readonly IUnitOfWork _unitOfWork;
        private readonly IMapper _mapper;
        public CompanyService(IUnitOfWork unitOfWork, IMapper mapper)
        {
            _unitOfWork = unitOfWork;
            _mapper = mapper;
        }

        public async Task<bool> AddAsync(AddCompanyDto requestDto)
        {
            requestDto.Logo = "iVBORw0KGgoAAAANSUhEUgAAAdkAAAJ8CAYAAACyftvCAAAAAXNSR0IArs4c6QAAAARnQU1BAACxjwv8YQUAAAAJcEhZcwAADsMAAA7DAcdvqGQAALVwSURBVHhe7f2Hty1Fvf/ 9nv / gGfeOZ9xnPM / 9 / X73ZyJKRuEoHj0es2LAcDyiYkCQIIoICAISJOecc8aMCRVJioLkDCIZATkgB + Egxr7rVXt9F7Vrz7X22ps19 + 7e+ / se4zvmnN3VVdXVPevTVV31rX / 6P / 7P / 9WlpaWlpaWlzb2lyKalpaWlpY3J / unt7 / ";
            var company = new Company()
            {
                Address = requestDto.Address,
                CIN = requestDto.CIN,
                IsActive = true,
                Name = requestDto.Name,
                OldName = requestDto.OldName,
                Logo = Utils.ConvertBase64ToByte(""),
                CreatedDate = Utils.CurrentDateTime,
                CreatedBy = requestDto.ActionBy
            };
            await _unitOfWork.CompanyRepository.AddAsync(company);
            await _unitOfWork.SaveChanges();
            return true;
        }

        public async Task<bool> DeleteAsync(DeleteCompanyDto requestDto)
        {
            var company = await _unitOfWork.CompanyRepository.GetByIdAsync(requestDto.Id);
            company.IsActive = false;
            _unitOfWork.CompanyRepository.Update(company);
            return true;
        }

        public async Task<List<CompanyDto>> GetAllAsync()
        {
            var companies = _unitOfWork.CompanyRepository.GetAllAsQueryableAsync()
                .Where(x=>x.IsActive)
                .Select(x => new CompanyDto()
                {
                    Address=x.Address,
                    CIN=x.CIN,
                    Logo = Utils.ConvertByteToBase64(x.Logo),
                    Name = x.Name,
                    OldName = x.OldName
                }).ToList();
            return companies;
        }

        public async Task<CompanyDto> GetByIdAsync(GetByIdCompanyDto requestDto)
        {
            var company = await _unitOfWork.CompanyRepository.GetByIdAsync(requestDto.Id);
            var result = _mapper.Map<CompanyDto>(company);
            result.Logo = Utils.ConvertByteToBase64(company.Logo);
            return result;
        }

        public async Task<bool> UpdateAsync(UpdateCompanyDto requestDto)
        {
            requestDto.Logo = "iVBORw0KGgoAAAANSUhEUgAAAdkAAAJ8CAYAAACyftvCAAAAAXNSR0IArs4c6QAAAARnQU1BAACxjwv8YQUAAAAJcEhZcwAADsMAAA7DAcdvqGQAALVwSURBVHhe7f2Hty1Fvf/ 9nv / gGfeOZ9xnPM / 9 / X73ZyJKRuEoHj0es2LAcDyiYkCQIIoICAISJOecc8aMCRVJioLkDCIZATkgB + Egxr7rVXt9F7Vrz7X22ps19 + 7e+ / se4zvmnN3VVdXVPevTVV31rX / 6P / 7P / 9WlpaWlpaWlzb2lyKalpaWlpY3J / unt7 / ";
            var company = await _unitOfWork.CompanyRepository.GetByIdAsync(requestDto.Id);
            company.Address = requestDto.Address;
            company.CIN = requestDto.CIN;
            company.IsActive = true;
            company.Name = requestDto.Name;
            company.OldName = requestDto.OldName;
            company.Logo = Utils.ConvertBase64ToByte(requestDto.Logo);
            company.ModifiedDate = Utils.CurrentDateTime;
            company.ModifiedBy = requestDto.ActionBy;

            _unitOfWork.CompanyRepository.Update(company);
            return true;
        }
    }
}
